script: |
  super -f text -I q12300.spq | sort > q12300.out

inputs:
  - name: q12300.spq
    data: |
      SELECT - col0 / ( - col2 ) * + 2 + 32 AS col1, - 16 AS col0 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q12300.out
    data: |
      34	-16
      34	-16
      36	-16
